CREATE DATABASE genetics;
GO

use genetics;
GO

SET FOREIGN_KEY_CHECKS=0;
DROP TABLE IF EXISTS `database`.`analysis`;
DROP TABLE IF EXISTS `database`.`gene_clinical_synopsis`;
DROP TABLE IF EXISTS `database`.`migrations`;
DROP TABLE IF EXISTS `database`.`patients_information`;
DROP TABLE IF EXISTS `database`.`pipelines`;
DROP TABLE IF EXISTS `database`.`samples`;
DROP TABLE IF EXISTS `database`.`uploads`;
DROP TABLE IF EXISTS `database`.`users`;
DROP TABLE IF EXISTS `database`.`workspaces`;
CREATE TABLE `analysis` (
  `id` int NOT NULL AUTO_INCREMENT,
  `name` varchar(255) COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `user_id` int DEFAULT NULL,
  `data_type` int DEFAULT NULL,
  `control` varchar(255) COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `genotype` varchar(255) COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `createdAt` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updatedAt` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `igv_local_path` varchar(255) COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `sample_id` int DEFAULT NULL,
  `project_id` int DEFAULT NULL,
  `p_type` varchar(255) COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `analyzed` timestamp NULL DEFAULT NULL,
  `variants` int DEFAULT NULL,
  `size` bigint DEFAULT NULL,
  `status` int DEFAULT NULL,
  `variants_to_report` text COLLATE utf8mb3_unicode_ci,
  `file_path` varchar(255) COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `description` text COLLATE utf8mb3_unicode_ci,
  `is_deleted` int DEFAULT '0',
  `pipeline_id` int DEFAULT NULL,
  `access_user_ids` text COLLATE utf8mb3_unicode_ci,
  `upload_id` int DEFAULT NULL,
  `assembly` varchar(255) COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci;
CREATE TABLE `gene_clinical_synopsis` (
  `id` int NOT NULL AUTO_INCREMENT,
  `gene_omim` varchar(255) COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `gene_name` varchar(255) COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `pheno_omim` varchar(255) COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `pheno_name` varchar(255) COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `location` varchar(255) COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `createdAt` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updatedAt` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7399 DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci;
CREATE TABLE `migrations` (
  `id` int NOT NULL AUTO_INCREMENT,
  `name` varchar(255) COLLATE utf8mb3_unicode_ci NOT NULL,
  `run_on` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=38 DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci;
CREATE TABLE `patients_information` (
  `id` int NOT NULL AUTO_INCREMENT,
  `first_name` varchar(255) COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `last_name` varchar(255) COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `dob` varchar(255) COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `phenotype` text COLLATE utf8mb3_unicode_ci,
  `createdAt` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updatedAt` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `sample_id` int DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci;
CREATE TABLE `pipelines` (
  `id` int NOT NULL AUTO_INCREMENT,
  `name` varchar(255) COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `version` varchar(255) COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `createdAt` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updatedAt` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci;
CREATE TABLE `samples` (
  `id` int NOT NULL AUTO_INCREMENT,
  `name` varchar(255) COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `user_id` int DEFAULT NULL,
  `data_type` int DEFAULT NULL,
  `control` varchar(255) COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `genotype` varchar(255) COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `createdAt` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updatedAt` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `file_size` bigint DEFAULT NULL,
  `file_type` varchar(255) COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `complete_status` int DEFAULT NULL,
  `assembly` varchar(255) COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci;
CREATE TABLE `uploads` (
  `id` int NOT NULL AUTO_INCREMENT,
  `original_name` varchar(255) COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `file_size` bigint DEFAULT NULL,
  `file_type` varchar(255) COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `upload_name` varchar(255) COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `is_deleted` int DEFAULT NULL,
  `file_path` varchar(255) COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `user_created` int DEFAULT NULL,
  `createdAt` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updatedAt` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `sample_id` int DEFAULT NULL,
  `fastq_pair_index` int DEFAULT NULL,
  `upload_status` int DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci;
CREATE TABLE `users` (
  `id` int NOT NULL AUTO_INCREMENT,
  `first_name` varchar(100) COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `last_name` varchar(100) COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `email` varchar(255) COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `password` varchar(255) COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `role` int DEFAULT NULL,
  `status` int DEFAULT NULL,
  `createdAt` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updatedAt` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `user_created` int DEFAULT NULL,
  `phone_number` varchar(255) COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci;
CREATE TABLE `workspaces` (
  `id` int NOT NULL AUTO_INCREMENT,
  `name` varchar(255) COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `last_modified` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `user_created_id` int DEFAULT NULL,
  `number` int DEFAULT NULL,
  `pipeline` int DEFAULT NULL,
  `createdAt` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updatedAt` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `dashboard` text COLLATE utf8mb3_unicode_ci,
  `is_deleted` int DEFAULT '0',
  `access_user_ids` text COLLATE utf8mb3_unicode_ci,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci;
BEGIN;
LOCK TABLES `database`.`gene_clinical_synopsis` WRITE;
